    by summarizing the weather conditions, water conditions, and food and cover during
    this period. Wildlife- including migratory birds, big game animals, furbearers,
    predators, rodents, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments. The public relations section discusses
